    "history-of-the-wildlife-areas-iroquois-national-wildlife-refuge-oak-orchard-wildlife-manag",nt"isopen":
    false,nt"url": null,nt"notes": "This report provides a history of four
    management areas in Western New York: Iroquois National Wildlife Refuge, Oak Orchard
    Management Area, Tonawanda Wildlife Management Area and John White Wildlife Management
    Area. This includes cultural heritage of the four areas, the geological history
    and evolution of Western New York, descriptions of the landscapes of these areas.
    These adjoining wetland areas in Orleans, Genesee, and Niagara Counties total more
    than 20,000 acres and comprise what may be the most productive and useful wildlife
    and recreational inland wetland complex in the eastern half of the United States.",nt"license_title":
